import React from 'react';

const CoffeeItem = ({coffee}) => {
    const {id, name, title, img, price,desc} = coffee
    return (
        <li>
           <img src={img} alt={title} />
           <h2> 분류 : {name} </h2> 
           <h3> {title} </h3> 
           <p>가격 : {price} </p>
           <p>정보 : {desc} </p>
        </li>
    );
};

export default CoffeeItem;
